// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className=" flex items-center justify-center bg-green-900">
     <div className=" w-full h-full sm:w-[60%] sm:h-[60%] p-5 rounded-lg bg-zinc-700 shadow-xl">
      <div className=" flex h-[30px] text-center">
        <div className='text-2xl text-neutral-300 font-bold hover:text-green-700 transition-all pb-1'>Developer</div>
        <span className="text-lg text-neutral-300 font-bold hover:text-green-700 transition-all ">Home</span>
        <span className="text-lg text-neutral-300 font-bold hover:text-green-700 ">About</span>
        <span className="text-lg text-neutral-300 font-bold hover:text-green-700 ">Skill</span>
        <span className="text-lg text-neutral-300 font-bold hover:text-green-700 ">Experience</span>
        <span className='text-neutral-300 font-bold hover:text-green-700 transition-all '>Contact</span>
      </div>
     </div>
    </div>
  );
}

export default App;
